  false,\n\t\"url\": null,\n\t\"notes\": \"A nesting survey for bald eagles (Haliaeetus
  leucocephalus) was conducted from May 2-9, 1981, on a portion of Amchitka Island,
  Aleutian Islands Unit, Alaska Maritime National Wildlife Refuge. The survey was
  conducted after completing a search of the island for Aleutian Canada Geese (Branta
  canadensis leucopareia). The survey required approximately 6 biologist days including
  time allowed for inclement weather.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
